# 超出了时间限制
class Solution:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        i = 0
        max = -1
        if len(s)==1:
            max=1
        elif len(s)==0:
            max=0
        else:
            while i < len(s):
                tmp_set = set()
                for j in range(i,len(s)):
                    tmp_set.add(s[j])
                    if len(tmp_set) == j-i+1:
                        max = j-i+1 if j-i+1 > max else max
                    else:
                        continue
                i += 1
        print(max)
        return  max

